import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route } from "react-router-dom";
import "./index.css";
import App from "./App";

const Routes = <BrowserRouter><App /></BrowserRouter>;

ReactDOM.render(Routes, document.getElementById("root"));
